import "./header.css";
import "./headerResponsive.css";

export default function HeaderA() {
  return (
    <header>
      <div class="divDelHeader">
        <h1>¡Actúa para cambiar el mundo!</h1>
        <h2>
          Fomentamos el vínculo entre empresas y organizaciones civiles para
          generar un impacto positivo en la sociedad. Descubrí diferentes
          maneras de involucrar tu organización con la sociedad.
        </h2>
      </div>
    </header>
  );
}
